import * as React from "react";
import * as bs from '../../modules/bootstrap-4.1.3-dist/css/bootstrap.css';

import futureBrightLogo from './FutureBrightLogo.svg';
import settingsImg from './gear-icon.png';
import notificationsImg from './bell-icon.png';
import profileImg from './profile-icon.jpeg';

import "./Header.css";

import Navbar from 'react-bootstrap/NavBar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';

const Header = () => {
  return (
    <Navbar bg="dark" expand="lg">
      <Navbar.Brand href="#home">FutureBright</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-success">Search</Button>
        </Form>
        <Nav className="mr-auto">
          <Nav.Link href="#settings"><img className="settings-link" src={settingsImg}></img></Nav.Link>
          <Nav.Link href="#notifications"><img className="settings-link" src={notificationsImg}></img></Nav.Link>
          <Nav.Link href="#profile"><img className="settings-link" src={profileImg}></img></Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );

  /* return (
    <div className="topnav">
      <a href="#"><img src={siteLogo} className="Future-Bright-Logo" alt="logo" /></a>
      <input></input>
      <div className="options">
        <a href="#"><img src={settingsImg} className="settings"></img></a>
        <a href="#"><img src={notificationsImg} className="notifications"></img></a>
        <a href="#"><img src={profileImg} className="profile"></img></a>
      </div>
    </div>
  ); */
}

export default Header;
